```{.r .cell-code  code-summary="Write moy.db to the database."}
if (isFALSE(duckdb::dbExistsTable(dbconn, "db/moy.db"))) {
    dplyr::tbl(dbconn, filtered_path) |>
        dplyr::select(started_at, member_casual) |>
