```{.r .cell-code  code-summary="Save the chi-square statistic and degrees of freedom values in a tibble format to add to the gtsummary table."}
data_tibble <- transformData(conn = dbconn, path = "db/hod.db", select_cols = c("hr",
    "member_casual"))

chiResult <- chisqTest(data = data_tibble, variable = "hr", by = "member_casual")
