```{.r .cell-code}
qdf <- dplyr::tbl(dbconn, "db/speed.db") |>
    dplyr::select(mph) |>
    dplyr::collect()

quartiles <- quantile(qdf$mph, probs = c(0.25, 0.5, 0.75))

gplot <- qdf |>
    plotter(title = "Estimated Average Trip Speed", x_label = "MPH", y_label = "Trips",
        x_col = mph, geomType = "column", isHistogram = TRUE, angle = 45, color_col = "transparent",
        vline_color = "lightyellow", vline_size = 0.5, low = "blue", high = "red",
        binwidth = \(x) 2 * IQR(x)/(length(x)^(1/3)), breaks = seq(1, 20,
            by = 1), limits = c(1, 20), quartiles = quartiles)

gplot
```

